static void cgmbox_log_debug_bin(char *file_name, int file_line, char *data, unsigned char *bin, unsigned int bin_len)
{
	unsigned int i;
	FILE *ph = 0;
	char buf[2048] = { 0 };

	if (bin_len == 0)
	{
		return;
	}

	printf("-----------------%s-------------------\n", data);
	snprintf(buf, 2048, "DEBUG:%s:%s:%s:%d ", __DATE__, __TIME__, file_name, file_line);

	ph = fopen("cgmbox_debug.txt", "a+");
	if (ph == 0)
	{
		return;
	}
	fwrite(buf, 1, strlen(buf), ph);
	fwrite(data, 1, strlen(data), ph);
	for (i = 0; i < bin_len; i++)
	{
		char data[12] = { 0 };
		snprintf(data, 12, "0x%02X, ", bin[i]);
		fwrite(data, 1, strlen(data), ph);
		if ((i + 1) % 16) \
			printf("%02X ", bin[i]); \
		else\
			printf("%02X\n", bin[i]); \
	}
	fwrite("\n ", 1, strlen("\n "), ph);
	printf("\n");
	fclose(ph);
}

#define CGMBOX_LOG_DEBUG(a, b, c) cgmbox_log_debug_bin(__FILE__, __LINE__, a, b, c)

