static int example_sm4_encrypt_cmp(unsigned char *data, unsigned long data_len, unsigned char *goal_data, unsigned long goal_len, unsigned char *key, cgmbox_sm4_block_cipher_param param)
{
	int ret = 0;
	unsigned char *encrypt_data = 0;
	unsigned long encrypt_data_len = data_len + 16;

	encrypt_data = (unsigned char *)calloc(1, encrypt_data_len);

	ret = cgmbox_sm4_encrypt(key, param, data, data_len, encrypt_data, &encrypt_data_len);
	if (ret)
	{
		free(encrypt_data);
		return -1;
	}
	
	ret = memcmp(encrypt_data, goal_data, encrypt_data_len);
	free(encrypt_data);
	return ret;
}

static int example_sm4_encrypt_stream_cmp(unsigned char *data, unsigned long data_len, unsigned char *goal_data, unsigned long goal_len, unsigned char *key, cgmbox_sm4_block_cipher_param param, unsigned long bloak_size)
{
	int ret = 0, total_lens = 0;
	cgmbox_sm4_ctx_t ctx;
	unsigned char *encrypt_data = 0;
	unsigned long encrypt_data_lens = data_len + 16, len = 0, lens = 0, encrypt_data_len = 0;

	encrypt_data = (unsigned char *)calloc(1, encrypt_data_lens);

	cgmbox_sm4_encrypt_init(&ctx, key, param);
	while (data_len)
	{
		len = data_len > bloak_size ? bloak_size : data_len;
		encrypt_data_len = encrypt_data_lens - lens;
		cgmbox_sm4_encrypt_update(&ctx, data, len, encrypt_data + lens, &encrypt_data_len);
		//if (1)
		//{
		//	total_lens += (len - encrypt_data_len);
		//	printf("ÊäÈë³¤¶È:%d Êä³ö³¤¶È:%d ÒÅÁô³¤¶È: %d\n", len, encrypt_data_len, total_lens);
		//}
		data_len -= len;
		data += len;
		lens += encrypt_data_len;
	}
	encrypt_data_len = encrypt_data_lens - lens;
	cgmbox_sm4_encrypt_final(&ctx, encrypt_data + lens, &encrypt_data_len);
	//LOG_DATA(encrypt_data, goal_len);
	ret = memcmp(encrypt_data, goal_data, goal_len);
	free(encrypt_data);
	return ret;
}

