static int example_sm2_gen_key(unsigned char *data, unsigned char data_len, unsigned char *signer_id, unsigned int signer_id_len)
{
	int ret = 0;
	cgmbox_cm2_public_key public_key;
	cgmbox_cm2_private_key private_key;
	cgmbox_sm2_sign_data sign_data;
	cgmbox_sm2_cipher_bolb cipher_data;
	unsigned char digest[CGMBOX_SM3_DIGEST_LENGTH] = { 0 }, *plain_text = 0;
	unsigned int plain_text_len = 0;


	/* Éú³ÉSM2¹«Ë½Ô¿¶Ô */
	ret = cgmbox_sm2_keygen(&public_key, &private_key);
	if (ret)
	{
		return ret;
	}

	/* sm2Ç©ÃûÊý¾ÝÔ¤´¦Àí */
	ret = cgmbox_sm3_preprocess(data, data_len, (unsigned char *)&public_key, sizeof(cgmbox_cm2_public_key), signer_id, signer_id_len, digest);
	if (ret)
	{
		return ret;
	}

	/* SM2Ç©Ãû */
	ret = cgmbox_sm2_sign(private_key, digest, CGMBOX_SM3_DIGEST_LENGTH, &sign_data);
	if (ret)
	{
		return ret;
	}

	/* SM2ÑéÇ© */
	ret = cgmbox_sm2_verify(public_key, digest, CGMBOX_SM3_DIGEST_LENGTH, sign_data);
	if (ret)
	{
		return ret;
	}

	cipher_data.cipher = (unsigned char *)calloc(1, data_len);

	/* SM2¼ÓÃÜ */
	ret = cgmbox_sm2_encrypt(public_key, data, data_len, &cipher_data);
	if (ret)
	{
		free(cipher_data.cipher);
		return ret;
	}

	/* SM2½âÃÜ */
	plain_text_len = cipher_data.cipher_len;
	plain_text = (unsigned char *)calloc(1, plain_text_len);

	ret = cgmbox_sm2_decrypt(private_key, &cipher_data, plain_text, &plain_text_len);
	if (ret)
	{
		free(cipher_data.cipher);
		free(plain_text);
		return ret;
	}

	if (memcmp(plain_text, data, data_len) != 0)
	{
		free(cipher_data.cipher);
		free(plain_text);
		return ret;
	}

	free(cipher_data.cipher);
	free(plain_text);
	return ret;
}

